import '../C_dashboard/style_dashboard.css';
import React from 'react';
import icon_feed from '../C_dashboard/icons/icon_feed.png';
import icon_search from '../C_dashboard/icons/icon_search.png';
import icon_upload from '../C_dashboard/icons/icon_upload.png';


function NavBar(props) {
  
  return (    
    <div class="menubar">
      <div class="menuoption" id="home">
        <img src={icon_feed} className="menuicon" alt="icon" />
        Home
      </div>
      <div class="menuoption" id="upload">
        <img src={icon_upload} className="menuicon" alt="icon" />
        Upload
      </div>
    </div>  
  );
}

export default NavBar;

<h1>Actual navbar option: {props.menubar_option}</h1>
{(() => {
  switch (props.menubar_option) {
    case "home":
      return <h1>Rendered navbar option: home</h1>;
      break;
    case "notifications":
      return <h1>Rendered navbar option: notifications</h1>;
      break;
    default:
      return <h1>Rendered navbar option: none</h1>;
  }
})()}
